def getCell(table, row, col):
	value = 0
	if row < 0 or col < 0 or row >= SIZE or col >= SIZE:
	    return value
	try:
		value = table[row][col]
	except:
		value = 0
#	print(f"[{row}][{col}] = {value}")
	return value
	
def getAliveCells(table, row, col):
	aliveCells = 0
	
	aliveCells += getCell(table, row-1, col-1)
	aliveCells += getCell(table, row-1, col)
	aliveCells += getCell(table, row-1, col+1)
	
	aliveCells += getCell(table, row, col-1)
	aliveCells += getCell(table, row, col+1)
	
	aliveCells += getCell(table, row+1, col-1)
	aliveCells += getCell(table, row+1, col)
	aliveCells += getCell(table, row+1, col+1)
#	print(f"[{row}][{col}] = {aliveCells}")
	return aliveCells

	
def cgl(currentStep, nextStep, rowIndex=0):	
	for row in range(rowIndex, SIZE, CORES):
#		print(row)
		for col in range(0, SIZE):
			aliveCells = getAliveCells(currentStep, row, col)
			if aliveCells == 3 or ((currentStep[row][col] == 1 and aliveCells == 2)):
			    nextStep[row][col] = 1
			else:
			    nextStep[row][col] = 0
	return
	
def cgl2(curr, nextStep, steps): #for one or two threads
    if CORES > 1:
	    for step in range(0, steps):
	        t1 = threading.Thread(target=cgl, args=(curr, nextStep, 1))
	        t1.start()
	        cgl(curr, nextStep, 0)
	        t1.join()
	        curr = nextStep
	        nextStep = emptyData
    else:
	    for step in range(0, steps):
		    cgl(curr, nextStep, 0)
		    curr = nextStep
		    nextStep = emptyData


def cglp(curr, nextStep, steps): #multi thread
	if CORES <= 2:
		cgl2(curr, nextStep, steps)
		return
		
	threads = []
	for step in range(0, steps):
		for n in range(0, CORES):
			t = threading.Thread(target=cgl, args=(curr, nextStep, n))
			threads.append(t)
			t.start()
		
		for t in threads:
			t.join()
			threads.remove(t)
				
	
